import React, {Component} from 'react'

export class AddTodo extends Component {
	render() {
		return (
			<form>
				<input
					type="text"
					name="title"
					style={{ padding: '5px', flex: 1 }}
				/>
				<input 
					type="submit" 
					value="Submit" 
					className="btn"
				/>
			</form>
		) 
	}
}

export default AddTodo;
